import React, { memo } from 'react'

import VHE from '../global/vhes/VHE'

import './css/Vhes.scss'

const Vhes = memo((props) => {

    const ConditionalWrapper = ({vhe, index, condition}) => {
        return condition ? (
            <div style={{width: '100px', height: '100px', backgroundColor: 'red'}}></div>
        ) : (
            null
        )
    }

    return (
        <>
            <div id={props.display_list_CLASSNAME}>
                {props.data.map((vhe, index) => (
                    <ConditionalWrapper condition={ vhe, index,  index < 9 }>
                    </ConditionalWrapper>
                ))}
            </div>
        </>
    )
})

export default Vhes
